import react from "react";
import { Text, StyleSheet,View, ScrollView,TouchableOpacity} from "react-native"
import React,{useState} from 'react';
import { FontAwesomeIcon } from '@fortawesome/react-native-fontawesome'
import { faMap} from '@fortawesome/free-solid-svg-icons/faMap'
import { faUsers} from '@fortawesome/free-solid-svg-icons/faUsers'
import { faBookmark} from '@fortawesome/free-solid-svg-icons/faBookmark'


import { LinearGradient, } from 'expo-linear-gradient';
import  '@react-navigation/native';
import { Pessoa } from "./Pessoa";


const image = {uri: 'data:image/jpeg;base64,'};

export const Conexoes = ({navigation}, props) =>{

  const pessoas = [
    {
      id: 1,
      nome: "João",
      sobrenome: "Silva",
      email: "joao.silva@email.com"
    },
    {
      id: 2,
      nome: "Maria",
      sobrenome: "Santos",
      email: "maria.santos@email.com"
    },
    {
      id: 3,
      nome: "Pedro",
      sobrenome: "Ferreira",
      email: "pedro.ferreira@email.com"
    },
    {
      id: 4,
      nome: "Ana",
      sobrenome: "Oliveira",
      email: "ana.oliveira@email.com"
    },
    {
      id: 5,
      nome: "Lucas",
      sobrenome: "Ribeiro",
      email: "lucas.ribeiro@email.com"
    },
    {
      id: 6,
      nome: "Mariana",
      sobrenome: "Alves",
      email: "mariana.alves@email.com"
    },
    {
      id: 7,
      nome: "Carlos",
      sobrenome: "Pereira",
      email: "carlos.pereira@email.com"
    },
    {
      id: 8,
      nome: "Isabela",
      sobrenome: "Cruz",
      email: "isabela.cruz@email.com"
    },
    {
      id: 9,
      nome: "Gustavo",
      sobrenome: "Martins",
      email: "gustavo.martins@email.com"
    },
    {
      id: 10,
      nome: "Sofia",
      sobrenome: "Gonçalves",
      email: "sofia.goncalves@email.com"
    },
    {
      id: 11,
      nome: "Luiz",
      sobrenome: "Campos",
      email: "luiz.campos@email.com"
    }
  ];


    return(

        
        <LinearGradient colors={['#fefffc', '#5eb6f5']} style={styles.container}>
                      
          
        <View style={{ flex: 1 }}>
        <View style={styles.tituloContainer}>
        <FontAwesomeIcon icon={faUsers} size={40}/>

          <Text style={styles.titulo}>Conexões</Text>
          
        </View>
     

      {/* Conteúdo rolável */}
      <ScrollView style={{ flex: 1 }}>
        {/* Seu conteúdo aqui */}
        
        {pessoas.map(pessoas => (
          <Pessoa imagem={'https://scontent.fnat1-1.fna.fbcdn.net/v/t39.30808-6/365428613_6509308685816133_7421590953227553555_n.jpg?_nc_cat=107&ccb=1-7&_nc_sid=a2f6c7&_nc_eui2=AeGP__yAb8HpIhtQSlUNtOIEUhcHg5_r8uxSFweDn-vy7El27cEjxenmJkpdyYzfvbP-2fud0S604XGLq04CBlr2&_nc_ohc=EzrtGnBBNuIAX8x7bv5&_nc_ht=scontent.fnat1-1.fna&oh=00_AfAbBj3H0d4s6jacUc4IKsXIVm3fOZkkN7Ic5D2ByE598w&oe=6520FBB2'} nome= {pessoas.nome} sobrenome={pessoas.sobrenome} email= {pessoas.email}></Pessoa>
        ))}
       
      </ScrollView>

      <View style={styles.menu}>

      
          <TouchableOpacity onPress={() => navigation.navigate('telaPrincipal')}>
                    <FontAwesomeIcon icon={faMap} size={40} />
            </TouchableOpacity>
            
            <TouchableOpacity onPress={()=> navigation.navigate('conexoes')}>
                <FontAwesomeIcon icon={faUsers} size={40} />
            </TouchableOpacity>

            <TouchableOpacity >
                <FontAwesomeIcon icon={faBookmark} size={40} />
            </TouchableOpacity>
        </View>
     </View>
        </LinearGradient>
     
    
  );


  

}

const styles = StyleSheet.create({
  
  tituloContainer:{
    
    justifyContent:  'flex-start',
    alignItems:'center',
    
    flexDirection:'row',
    paddingLeft:20,
    paddingRight:20,
    

  },
 
  titulo:{
    textAlign:'left',
    fontSize:40,
    fontWeight:'bold',
    marginTop:20,
    marginBottom:40,
    marginHorizontal:10
  },
  container: {
    minWidth:"100%",
    flex: 1,
    justifyContent: 'center',
    padding: 20,
    marginTop:30,
    marginBottom:10,

  },
  menu:{ 
    height: 60,
    backgroundColor: '#FFF',
    justifyContent: 'space-around', 
    alignItems: 'center', 
    flexDirection:'row',
    paddingTop:10,
    
    borderRadius:20,
    shadowColor: '#000',
    shadowOffset: { width: 0, height: 2 },
    shadowOpacity: 0.3,
    shadowRadius: 4,
    elevation: 5 // Adiciona sombra no Android (opcional)
  }
  
  
 
    


}
    )
